import React, { useState, useEffect } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button } from '@mui/material';
import axios from 'axios';

const TopStocks = () => {
    const [stocks, setStocks] = useState([]);

    useEffect(() => {
        const fetchStocks = async () => {
            try {
                const symbols = ['TPL', 'NVDA', 'PCTY', 'PLRX']; // Example stock symbols
                const promises = symbols.map(symbol =>
                    axios.get(`https://www.alphavantage.co/query?function=GLOBAL_QUOTE&symbol=${symbol}&apikey=YOUR_API_KEY`)
                );
                const results = await Promise.all(promises);
                const stocksData = results.map(result => ({
                    symbol: result.data['Global Quote']['01. symbol'],
                    price: result.data['Global Quote']['05. price'],
                    change: result.data['Global Quote']['09. change'],
                    aiScore: Math.floor(Math.random() * 21) + 79 // Random AI Score for demo purposes
                }));
                setStocks(stocksData);
            } catch (error) {
                console.error('Error fetching stock data:', error);
            }
        };

        fetchStocks();
    }, []);

    return (
        <TableContainer component={Paper}>
            <Table aria-label="simple table">
                <TableHead>
                    <TableRow>
                        <TableCell>Company</TableCell>
                        <TableCell align="right">Price</TableCell>
                        <TableCell align="right">AI Score</TableCell>
                        <TableCell align="center">AI Analysis</TableCell>
                        <TableCell align="center">Add to Portfolio</TableCell>
                    </TableRow>
                </TableHead>
                <TableBody>
                    {stocks.map((stock) => (
                        <TableRow key={stock.symbol}>
                            <TableCell component="th" scope="row">{stock.symbol}</TableCell>
                            <TableCell align="right">{stock.price}</TableCell>
                            <TableCell align="right">
                                <Button variant="outlined" color="primary">{stock.aiScore}</Button>
                            </TableCell>
                            <TableCell align="center">
                                <Button variant="contained" color="primary">Generate</Button>
                            </TableCell>
                            <TableCell align="center">
                                <Button variant="contained" color="secondary">Add to Portfolio</Button>
                            </TableCell>
                        </TableRow>
                    ))}
                </TableBody>
            </Table>
        </TableContainer>
    );
};

export default TopStocks;
